import Body from './Body';
import About from './About';
import {Switch,Route, Router} from 'react-router-dom';

function Pages() {
    return (
        // <Router>
            <Switch>
                <Route path="/"><Body/></Route>
                <Route path="/about" exact component={About}/>
            </Switch>

    )
}

export default Pages
